import React from 'react'
import styled from 'styled-components'
import { Header } from '../main-pages/header'
import { Margin36 } from '../component/styledComponent'
import { TermBox } from './termBox'

const Container = styled.div`
  width: 100%;
`
const Title = styled.text`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 18px;
  line-height: 18px;
  color: #000000;
`
const BodyContainer = styled.div`
  margin: 0 auto;
  width: 1280px;
  height: 800px;
`

export const Location = () => {
  return (
    <Container>
      <Header />
      <Margin36 />
      <BodyContainer>
        <TermBox
          title="제1조(목적)"
          contents={[
            {
              text: '본 약관은 서비스 이용약관에 동의한 이용자(이하 "회원" 또는 "사용자")가 업텐(이하 "회사")에서 제공하는 주다 서비스(이하 "서비스"라 하며, 추후 서비스명은 변경될 수 있음)를 이용함에 있어 회사와 회원 간 또는 회원 간의 권리, 의무 및 책임사항 및 서비스 이용조건 및 절차 등 기본적인 사항을 규정함을 목적으로 합니다. 회사가 서비스 이용약관을 개정하는 경우에는 홈페이지 또는 애플리케이션에 게시하거나 개별적으로 공지할 것입니다.',
              isTab: false,
              isDot: false,
            },
          ]}
        />
        <TermBox
          title="제2조(이용약관의 효력 및 변경)"
          contents={[
            {
              text: '1. 본 약관은 서비스를 신청한 고객 또는 개인위치정보주체가 본 약관에 동의하고 회사가 정한 소정의 절차에 따라 서비스의 이용자로 등록함으로써 효력이 발생합니다.',
              isTab: false,
              isDot: false,
            },
            {
              text: '2. 회사는 본 약관의 내용을 회원이 쉽게 알 수 있도록 서비스 초기 화면에 게시하거나 기타의 방법으로 공지합니다.',
              isTab: false,
              isDot: false,
            },
            {
              text: '3. 회원이 애플리케이션에서 본 약관의 “약관 동의” 버튼을 클릭하였을 경우 본 약관의 내용을 모두 읽고 충분히 이를 이해하였으며, 그 적용에 동의한 것으로 봅니다.',
              isTab: false,
              isDot: false,
            },
            {
              text: '4. 회사는 필요하다고 인정되면 본 약관을 변경할 수 있으며, 회사가 약관을 개정할 경우에는 기존약관과 개정약관 및 개정약관의 적용일자와 개정사유를 명시하여 현행약관과 함께 그 적용일자 7일 전부터 적용일 이후 상당한 기간 동안 공지합니다. 다만, 개정 내용이 회원에게 불리한 경우에는 그 적용일자 30일 전부터 적용일 이후 상당한 기간 동안 각각 이를 홈페이지 또는 애플리케이션에 게시하여 고지합니다.',
              isTab: false,
              isDot: false,
            },
            {
              text: '5. 회사가 전항에 따라 회원에게 공지하거나 통지하면서 공지 또는 통지ㆍ고지일로부터 개정약관 시행일 7일 후까지 거부 의사를 표시하지 아니하면 승인한 것으로 본다는 뜻을 명확하게 고지하였음에도 불구하고 거부의 의사표시가 없는 경우에는 변경된 약관에 승인한 것으로 봅니다. 회원이 개정약관에 동의하지 않을 경우 회원은 이용계약을 해지할 수 있습니다.',
              isTab: false,
              isDot: false,
            },
          ]}
        />
        <TermBox
          title="제3조(약관 외 준칙)"
          contents={[
            {
              text: '본 약관에 규정되지 않은 사항에 대해서는 위치정보의 보호 및 이용 등에 관한 법률(이하 “위치정보법”이라고 합니다), 전기통신사업법, 정보통신망 이용촉진 및 보호 등에 관한 법률(이하 “정보통신망법”이라고 합니다), 개인정보보호법 등 관련 법령 또는 회사가 정한 서비스의 운영정책 및 규칙 등(이하 “세부지침”이라고 합니다)의 규정에 따릅니다.',
              isTab: false,
              isDot: false,
            },
          ]}
        />
        <TermBox
          title="제4조(서비스의 내용)"
          contents={[
            {
              text: '회사는 직접 위치정보를 수집하거나 위치정보사업자로부터 위치정보를 전달받아 아래와 같은 위치기반서비스를 제공합니다.',
              isTab: false,
              isDot: false,
            },
            {
              text: '1. 교회 찾기 : 현재 위치를 기반으로 주위 교회 정보를 제공합니다.',
              isTab: false,
              isDot: false,
            },
            {
              text: '2. 출석체크 : 현재 위치를 기반으로 교회 출석체크 기능을 제공합니다.',
              isTab: false,
              isDot: false,
            },
          ]}
        />
        <TermBox
          title="제5조(서비스 이용요금)"
          contents={[
            {
              text: '1. 회사가 제공하는 서비스는 기본적으로 무료입니다.',
              isTab: false,
              isDot: false,
            },
            {
              text: '2. 무선 서비스 이용 시 발생하는 데이터 통신료는 별도이며 가입한 각 이동통신사의 정책에 따릅니다.',
              isTab: false,
              isDot: false,
            },
            {
              text: '3. MMS 등으로 게시물을 등록할 경우 발생하는 요금은 회원이 가입한 이동통신사의 정책에 따릅니다.',
              isTab: false,
              isDot: false,
            },
          ]}
        />
        <TermBox
          title="제6조(서비스의 이용제한 및 중지)"
          contents={[
            {
              text: '1. 회사는 아래 각 호의 경우에는 회원의 서비스 이용을 제한하거나 중지시킬 수 있습니다.',
              isTab: false,
              isDot: false,
